package com.taxialaan.drivers.Api.response;import com.google.gson.annotations.SerializedName;public class ModelConfigMqtt {        @SerializedName("mqtt")        private Mqtt mqtt;        @SerializedName("location_refresh_interval")        private int locationRefreshInterval;        public void setMqtt(Mqtt mqtt){            this.mqtt = mqtt;        }        public Mqtt getMqtt(){            return mqtt;        }        public void setLocationRefreshInterval(int locationRefreshInterval){            this.locationRefreshInterval = locationRefreshInterval;        }        public int getLocationRefreshInterval(){            return locationRefreshInterval;        }}